import robloxGroup, asyncio
from robloxGroup import commands
from robloxGroup.functions import role, allies
group = commands.Bot(prefix="!", group_id=14116868, cookie="_|WARNING:-DO-NOT-SHARE-THIS.--Sharing-this-will-allow-someone-to-log-in-as-you-and-to-steal-your-ROBUX-and-items.|_")

@group.command
async def ally(ctx, group_id):
    if not group_id.isnumeric():
        return
    for _group in (await role.guilds_user(group, ctx.poster.user.userId)).data:
        print(_group)
        if _group.group.id == int(group_id) and _group.group.owner.userId == ctx.poster.user.userId:
            return await role.change(group, ctx.poster.user.userId, 80273648)
            
asyncio.run(group.run())